INSERT INTO `story_face` VALUES ('1', '可爱', '红扑扑的小脸蛋上，有一双水灵灵的眼镜。小辫儿朝天翘着，粉红色的发带在头上一颠一颠的，像两只飞舞的彩蝶。尤其逗人喜爱的，是她那张伶俐的小嘴。', '1-5', '女', '活泼', '正常');
INSERT INTO `story_face` VALUES ('2', '美丽', '一头如墨的黑发散在身后，紫色的蕾丝线将一束小发悬在耳侧，红色的衬衣外是一件方格的蕾丝小礼服，白皙的手腕上悬满了漂亮的镯子，小指上还戴了一个没有任何修饰的银戒，一切的装扮都是那样奢华精致，却让人感觉不出半点多余和累赘，仿佛她本来就应该穿成这样。', '15-20', '女', '调皮', '正常');
INSERT INTO `story_face` VALUES ('3', '聪明', '一头乌黑柔软的头发，梳着许多根又细又长的小辫子。雪白的瓜子脸，细长的眉毛下闪动着一双乌黑发亮的眼睛，流露出聪颖的光芒。', '5-10', '女', '安静', '正常');
INSERT INTO `story_face` VALUES ('4', '高贵', '有着阳光般亮泽的黑发，但浑身却散发着一种冰冷的漠然，明明那双浅绿色的眼眸中充满笑意，笑容却很远很远，像是白雾笼罩的山，一点都不真实，精致的紫色衬衫和他的贵族气质融合的完美无缺，举手投足优雅随意，犹如暗色中绽放的一朵诡异奇丽的曼陀罗。', '20-25', '男', '阴险', '正常');
INSERT INTO `story_face` VALUES ('5', '柔和美', '柔和素净如雪莲的一张脸，泛着暖玉一样莹润的光泽。双眼紧闭，长长密密的睫毛轻轻的抖动着，惹人怜爱。挺挺的鼻梁，微翘的鼻头，好看的鼻翼轻轻翕动。娇嫩的双唇弧线完美，唇色微微泛白，让人怜惜', '20-25', '女', '平静', '正常');
INSERT INTO `story_face` VALUES ('6', '多情', '脸如雕刻般五官分明，有棱有角的脸俊美异常。外表看起来好象放荡不拘，但眼里不经意流露出的精光让人不敢小看。一头乌黑茂密的头发，一双剑眉下却是一对细长的桃花眼，充满了多情，让人一不小心就会沦陷进去。高挺的鼻子，厚薄适中的红唇这时却漾着另人目眩的笑容。', '25-30', '男', '放荡', '正常');
INSERT INTO `story_person` VALUES ('13', '刁欣欣', '1-5', '女', '红扑扑的小脸蛋上，有一双水灵灵的眼镜。小辫儿朝天翘着，粉红色的发带在头上一颠一颠的，像两只飞舞的彩蝶。尤其逗人喜爱的，是她那张伶俐的小嘴。', '活泼_可爱');
